import React from "react";

export default function LoginView() {
  return (
    <div>
      <h3>Login</h3>

      <form>
        <input type="text" placeholder="Login" />
        <input type="password" placeholder="Login" />
        <button type="button">Login</button>
      </form>
    </div>
  );
}
